function minSizeSubarray(nums: number[], target: number): number {
    let n = nums.length;
    let prefixSum = new Array(2 * n + 1).fill(0);
    for (let i = 0; i < 2 * n; i++) {
        prefixSum[i + 1] = prefixSum[i] + nums[i % n];
    }

    if (prefixSum[n] === target) return n;
    if (prefixSum[n] < target && target % prefixSum[n] === 0) return n * (target / prefixSum[n]);
    if (prefixSum[n] < target && prefixSum[2 * n] < target) return -1;

    let minLen = Infinity;
    for (let i = 0; i < n; i++) {
        let targetSum = target;
        let low = i + 1, high = 2 * n;
        while (low <= high) {
            let mid = Math.floor((low + high) / 2);
            let currentSum = prefixSum[mid] - prefixSum[i];
            if (currentSum < targetSum) {
                low = mid + 1;
            } else {
                minLen = Math.min(minLen, mid - i);
                high = mid - 1;
            }
        }
    }

    return minLen === Infinity ? -1 : minLen;
}
